import MainHero from "../main-hero/MainHero";
import "./movies.scss";

function Movies() {
  return (
    <div>
      <MainHero />
      <section className="section">
        <div className="section-title">
          <h2 className="title">
            <i className="bi bi-collection-play"></i> All Movies
          </h2>
          <div className="line"></div>
        </div>
        <div className="movie-boxes"></div>
      </section>
    </div>
  );
}

export default Movies;
